function SelButton(props) {
    const [tab, setTab] = useState('sel-button');
    const onClick = () => {
        tab === "sel-button" ? setTab("on-sel-button") : setTab("sel-button");
    }
    return (
        <div>
            <button className={tab} onClick={onClick}>{props.answer}</button>

        </div>
    );
}

export default SelButton;
